import React from 'react'
import './Nav.css'

import { useEffect, useState } from "react";

function Nav() {
  const [count, setCount] = useState(0);

  if (count === 0) {
    const [name, setName] = useState("SmartRanks");
  }

  useEffect(() => {
    setCount(1);
  }, []);

  return (
    <div>
      {count}
      {name}
    </div>
  );
}

export default Nav;
